  constructor(){
    super()
    this.state={
      value2:''
    }
  }

  changevalue = ()=>{
    this.setState({
      value2:'receive'
    })
  }

  render(){
    return(
      <div>
        <Main1 change1={this.changevalue} value2 ={this.state.value2} />
      </div>
    )
  }
}

export default App;
